snippet.description:
Gradius Origins è la collection definitiva per gli amanti degli shoot'em up e di Gradius nella fattispecie! Maggiori informazioni QUI: https://bit.ly/GRADIUSplayerinside 
---
SCUSATE per l'audio in alcuni punti del video, purtroppo si è trattato di un disguido a video già registrato e mi era impossibile "sistemare". Chiedo venia. 
In ogni caso BUONA DOMENICA con le NEWS della settimana, anche per questa domenica di agosto.

INDICE DELLE #NEWS VIDEOGIOCHI:
0:00 - Intro con ringraziamenti;
0:32 - SPONSOR: Gradius Origins;
2:32 - Censure di giochi per adulti: MasterCard smentita da Valve;
3:33 - C'è il rischio che GTA, Saints Row, Duke Nukem e altri titoli vengano censurati?
4:23 - Kojima al lavoro su Physint ma il gioco è ancora lontanissimo;
5:03 - Metal Gear Solid 3 Delta Snake Eater non avrà il multiplayer al lancio;
5:28 - Battlefield 6 potrebbe "battere" Call of Duty?
6:13 - GTA 6 potrebbe costare anche 110 euro ma lo comprerebbero comunque tutti;
6:40 - GTA 6 potrebbe rischiare di essere un flop?
7:07 - Microsoft verso la prossima generazione di console "non console"?
8:53 - Quanto costeranno le console di prossima generazione?
9:37 - Nintendo aumenta ufficialmente i prezzi in USA e ci chiede che cosa ne pensiamo delle cartucce di Switch 2;
10:57 - Microsoft interrompe lo sviluppo di Contraband;
11:33 - Silent Hill f sarà più action per compiacere i più giovani;
12:10 - Nintendo ha annunciato ufficialmente "My Mario";
12:36 - PS5: ecco i dati di vendita ufficiali della console, finora;
13:12 - Doom The Dark Ages: arriva l'update con molte novità;
13:29 - Light of Motiram: Tencent modifica il gioco dopo la denuncia di Sony;
14:40 - Game Pass: ecco i giochi della seconda metà di agosto 2025;
15:00 - Epic Games Store: ecco il gioco GRATIS dal 14 agosto 2025;
15:09 - NEWS A RAFFICA;
16:37 - Saluti veloci.
…
- Raiden & Midna

#ADVBYGRADIUSORIGINS #SPONSOREDBYGRADIUSORIGINS

